import React, { useState } from 'react';
import DeliveryTracker from './DeliveryTracker.jsx';

const Orders = ({ orders, onClose }) => {
  const [selectedOrder, setSelectedOrder] = useState(null);
  const [showTracker, setShowTracker] = useState(false);
  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  return (
    <div className="orders-modal">
      <div className="orders-content">
        <button className="close-button" onClick={onClose}>×</button>

        <div className="orders-header">
          <h2>My Orders</h2>
          <p>Track your order history and delivery status</p>
          <button 
            onClick={() => {
              console.log('Test button clicked');
              const testOrder = {
                orderId: 'TEST123',
                dish: 'Test Pizza',
                orderDate: new Date().toISOString(),
                address: '123 Test St',
                quantity: 2,
                totalPrice: '$25.99',
                paymentMethod: 'Credit Card',
                ingredients: [{ ingredient: 'cheese', quantity: 1, unit: 'cup' }]
              };
              setSelectedOrder(testOrder);
              setShowTracker(true);
            }}
            style={{ marginTop: '10px', padding: '8px 16px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer' }}
          >
            Test Track Order
          </button>
        </div>

        {orders.length === 0 ? (
          <div className="no-orders">
            <div className="no-orders-icon">📋</div>
            <h3>No Orders Yet</h3>
            <p>Start exploring dishes and place your first order!</p>
          </div>
        ) : (
          <div className="orders-list">
            {orders.map((order, index) => (
              <div key={index} className="order-card">
                <div className="order-header">
                  <h3 className="order-dish-name">{order.dish}</h3>
                  <div className="order-actions">
                    <button 
                      className="track-delivery-button"
                      onClick={() => {
                        console.log('Track button clicked for order:', order);
                        alert('Track button clicked! Order: ' + order.dish);
                        setSelectedOrder(order);
                        setShowTracker(true);
                      }}
                    >
                      🗺️ Track Delivery
                    </button>
                    <span className="order-status">Ordered</span>
                  </div>
                </div>

                <div className="order-details">
                  <div className="order-info">
                    <p><strong>Quantity:</strong> {order.quantity}</p>
                    <p><strong>Total:</strong> ${order.totalPrice}</p>
                    <p><strong>Payment:</strong> {order.paymentMethod}</p>
                    <p><strong>Ordered:</strong> {formatDate(order.orderDate)}</p>
                  </div>

                  <div className="order-address">
                    <p><strong>Delivery Address:</strong></p>
                    <p>{order.address}</p>
                  </div>
                </div>

                <div className="order-ingredients">
                  <h4>Ingredients:</h4>
                  <ul>
                    {order.ingredients.map((ingredient, idx) => {
                      const quantity = ingredient.quantity;
                      const unit = ingredient.unit || '';
                      const name = ingredient.ingredient || 'Unknown ingredient';

                      return (
                        <li key={idx}>
                          {quantity !== null ? `${quantity} ${unit} ` : ''}{name}
                        </li>
                      );
                    })}
                  </ul>
                </div>
              </div>
            ))}
          </div>
        )}

        {/* Delivery Tracker Modal */}
        {showTracker && selectedOrder && (
          <div>
            {console.log('Rendering DeliveryTracker modal with order:', selectedOrder)}
            <DeliveryTracker
              order={selectedOrder}
              onClose={() => {
                console.log('Closing DeliveryTracker modal');
                setShowTracker(false);
                setSelectedOrder(null);
              }}
            />
          </div>
        )}
      </div>
    </div>
  );
};

export default Orders;
